import React from "react";
import { BrowserRouter as Router, Link, Route, Switch } from "react-router-dom";
import TodoApp from "./TodoApp";
import HackerNewStories from "./HackerNewStories";

export const App = () => {
  return (
    <Router>
      <div className="container-fluid">
        <nav className="navbar navbar-expands-sm bg-light"></nav>
        <ul className="navbar-nav">
          <li className="nav-item">
            <Link to="/" className="nav-link">
              Home
            </Link>
          </li>
          <li className="nav-item">
            <Link to="/todo-app" className="nav-link">
              Todo App
            </Link>
          </li>
          <li className="nav-item">
            <Link to="/stories-app" className="nav-link">
              Hacker News Stories App
            </Link>
          </li>
        </ul>

        <Switch>
          <Route path="/todo-app">
            <TodoApp />
          </Route>
          <Route path="/stories-app">
            <HackerNewStories />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
};

export default App;

export const Home = () => {
  return <div>My Router</div>;
};
